import NavBar from "./components/navbar";
//import { Link } from "react-router-dom";

class App extends Component {

  render() {
    return (
      <div>        
        <NavBar
          totalCounters={this.state.counters.filter((c) => c.value > 0).length}
        />

      </div>      
    );
  }
}

export default App;
